import { Service } from "../model/serviceModel";
import axios from "axios";
const API_URL = "http://localhost:8080";
class ServiceService{
  async getService(api:string) : Promise<Service[]>{ 
    const response = await axios.get<Service[]>(`${API_URL}/${api}`);
    return response.data;
  }
}
const serviceServiceInstance = new ServiceService();
 export default  serviceServiceInstance;
